import React from 'react';
import { Text, StyleSheet, TouchableOpacity, FlatList } from 'react-native';

const Deliveries = ({ deliveries }) => {

  const delivery = ({ delivery }) => {
    console.log(delivery)
    return (
      <TouchableOpacity style={styles.row} onPress={() => navigation.navigate('Delivery', { id: delivery.id })}>
        <Text>Delivery {delivery.id}</Text>
        <Text>Store {delivery.store.name}</Text>
      </TouchableOpacity>
    );
  }

  return (
    <FlatList
      data={items}
      renderItem={delivery}
      keyExtractor={item=>item.id}
    />
  )
}

export default Deliveries;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    paddingTop: 20,
    paddingBottom: 20,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  row: {
    backgroundColor: "#4169e1",
    width: "80%",
    height: 100,
    color: "#ffffff",
    textAlign: "center",
    justifyContent: "center",
    marginVertical: 5,
    padding: 5,
    borderRadius: 5
  }
});
